import React from 'react'
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
const router = createBrowserRouter([
  {
    path: "/",
    element: <div>Home sweet home</div>,
  },
]);

const App = () => {
  return (
    <div>
      <RouterProvider router={router}></RouterProvider>    
    </div>
  )
}

export default App
